css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label > I {display: none}
.new_post_buttons {
  background: white center no-repeat url('data:image/png;base64,') !important;
}
.new_post_label:hover > SPAN {
  color:#000;
  background-color: rgba(192,192,192,.7);
}

.new_post_label > SPAN {
  font-size: 14px;
  font-family: Georgia, Times New Roman, sans-serif;
  font-style: italic;
  text-transform: lowercase;
  color: #222;
  letter-spacing: 1px;
}
.new_post_label {
  padding:10px 1px 69px 0 !important;
}

}
